import React, { useState } from 'react';

const InfoModal = async (e, props) => {

    
    const [message, setMessage] = useState('');
    var name = props.name

    e.preventDefault();
    
    try {
      const response = await fetch('http://localhost:8080/api/searchName', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          name
        }),
      });

      if (response.ok) {
        setMessage(`${name} 전송 성공`);
        console.log(message)
        
      } else {
        setMessage('전송 실패.');
        console.log(message)
      }
    } catch (error) {
      setMessage('서버 오류 발생.');
      console.log(message)
    }

return (
    <>
    <h1>Hello {props.name}</h1>
    <h1>{message}</h1>
    
    </>
);

}

export default InfoModal;
